function titleCase(str) {
  str = str.toLowerCase().split(' ');
  for (var n = 0; n < str.length; n++){
    str[n] = str[n].charAt(0).toUpperCase() + str[n].slice(1);
  }
  str = str.join(' ');
  return str;
}

titleCase("I'm a little tea pot");

